import React from "react";
import { Drawer } from "antd";
import DishForm from "./dishForm";
const DishDarawer = ({
  visible,
  title,
  onClose,
  onhandleAdd,
  firsItem,
  secondItem,
  thirdItem,
  fourthItem
}) => {
  return (
    <Drawer title={title} width={380} visible={visible} onClose={onClose}>
      <DishForm
        personal
        firsItem={firsItem}
        secondItem={secondItem}
        thirdItem={thirdItem}
        fourthItem={fourthItem}
        onClose={onClose}
        onhandleAdd={onhandleAdd}
      />
    </Drawer>
  );
};

export default DishDarawer;
